#include "colour.h"

#include <stdlib.h>
#include <stdio.h>
#include <string.h>

RGBAColour colourTables[NCOLOURTABLES][NCOLOURS];


RGBAColour colourFromTable(int tableId, int colourIndex)
{
    RGBAColour c = {255, 255, 255, 255};

    if (tableId > NCOLOURTABLES - 1 || tableId < 0)
        return c;

    int ind = colourIndex % NCOLOURS;
    return colourTables[tableId][ind];
}


RGBAColour colourFromString(char *colourString)
{
    RGBAColour c = {0, 0, 0, 255};

    if (colourString == NULL)
        return c;

    // Named colours
    if (strcmp("black", colourString) == 0)
        c = (RGBAColour){0, 0, 0, 255};
    else if (strcmp("white", colourString) == 0)
        c = (RGBAColour){255, 255, 255, 255};
    else if (strcmp("red", colourString) == 0)
        c = (RGBAColour){255, 0, 0, 255};
    else if (strcmp("green", colourString) == 0)
        c = (RGBAColour){0, 255, 0, 255};
    else if (strcmp("lawngreen", colourString) == 0)
        c = (RGBAColour){124, 252, 0, 255};
    else if (strcmp("blue", colourString) == 0)
        c = (RGBAColour){0, 0, 255, 255};
    else if (strcmp("orange", colourString) == 0)
        c = (RGBAColour){255, 117, 56, 255};
    else if (strcmp("orange1", colourString) == 0)
        c = (RGBAColour){255, 110, 74, 255};
    else if (strcmp("orange2", colourString) == 0)
        c = (RGBAColour){255, 43, 43, 255};
    else if (strcmp("teal", colourString) == 0)
        c = (RGBAColour){24, 167, 181, 255};
    else if (strcmp("skyblue", colourString) == 0)
        c = (RGBAColour){128, 218, 235, 255};
    else if (strcmp("chromakeygreen", colourString) == 0)
        c = (RGBAColour){1, 177, 64, 255};
    else if (strcmp("chromakeyblue", colourString) == 0)
        c = (RGBAColour){0, 71, 187, 255};
    else
    {
        // parse colour from rval,gval,bval,aval
        // Adapted from strsep man page
        char **ap = NULL;
        char *colourVals[5] = {0};

        for (ap = colourVals; (*ap = strsep(&colourString, ",")) != NULL;)
            if (**ap != '\0')
                if (++ap >= &colourVals[5])
                    break;

        int *p = (int*)&c;
        for (int i = 0; i < 4; i++)
            if (colourVals[i] != NULL)
                *p++ = atoi(colourVals[i]);

    }

    return c;
}

